import './App.css';
import Navbar from './components/navbar';
import TitlePage from './components/titlepage';

function App() {
  document.title = "Justin Santos | Portfolio";
  return (
    <div className="App">
      <Navbar />
      <TitlePage />
    </div>
  );
}

export default App;
